import logo from "./logo.svg";
import "./App.css";

function Feature() {
  return (
    <div>
      <header className="App-header">
        <h1>Day la test 1</h1>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload. <br />
          ababss
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function App() {
  return (
    <div>
      {/* <Feature></Feature> */}
      <YoutubeItem></YoutubeItem>
    </div>
  );
}

function YoutubeItem(props) {
  console.log(props);
  return (
    <div className="youtube-item">
      <div className="youtube-image">
        <img
          src="https://images.unsplash.com/photo-1712617137312-343869c90743?q=80&w=1770&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
          alt=""
        />
      </div>

      <div className="youtube-footer">
        <img
          src="https://images.unsplash.com/photo-1712609934576-083090663a8f?q=80&w=1964&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
          alt=""
          className="youtube-avatar"
        />

        <div className="youtube-info">
          <h3 className="youtube-title"> Learning React </h3>
          <h4 className="youtube-author"> CuongNguyen </h4>
        </div>
      </div>
    </div>
  );
}

export default App;
